            <div className={props.completed ? "todo-circle-ticked" : "todo-inner-circle"}>
            </div>

          <div style={{ textDecoration: todo.isCompleted ? "line-through" : "" }} className="todo-text">
            {todo.text}</div>
          <button onClick={ () => removeTodo(index)} className="todo-delete"></button>
        </li>
    );
}
